	add("harappa", "{\"term\":\"harappa\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A village in Punjab, eastern Pakistan\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An archaeological site near the village; the ancient city excavated at the site\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1995\u0027\u0027, Karl J. Schmidt, \u0027An Atlas and Survey of South Asian History\u0027, [http://books.google.com.au/books?id\u003dFzmkFXSgxqgC\u0026amp;pg\u003dPA12\u0026amp;dq\u003d%22Harappa%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dOsVpU7L2KoPvlAW-3oGABQ\u0026amp;redir_esc\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22Harappa%22\u0026amp;f\u003dfalse page 12\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The site, known as \u0027\u0027Harappa\u0027\u0027, contained evidence of a culture over 1,000 years older than any other yet discovered in South Asia and one which dated back to c. 2350 BCE, making it one of the four oldest centers of civilization in the world\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1996\u0027\u0027, Elizabeth E. Broadrup, \u0026quot;Kot Diji (Sind, Pakistan),\u0026quot; article in Trudy Ring, Robert M. Salkin, Sharon La Boda (editors), \u0027International Dictionary of Historic Places\u0027, Volume 5: Asia and Oceania, [http://books.google.com.au/books?id\u003dvWLRxJEU49EC\u0026amp;pg\u003dPA489\u0026amp;dq\u003d%22Harappa%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dOsVpU7L2KoPvlAW-3oGABQ\u0026amp;redir_esc\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22Harappa%22\u0026amp;f\u003dfalse page 489\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Now considered the first urban culture of the Indian subcontinent, the Harappan civilization was unknown to scholars until the twentieth century. Intrigued by large, earth-covered mounds at \u0027\u0027Harappa\u0027\u0027, on the Ravi River in the Punjab province of present-day Pakistan, archaeologists began excavating the site in 1921\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Himanshu Prabha Ray, \u0027The Archaeology of Seafaring in Ancient South Asia\u0027, [http://books.google.com.au/books?id\u003diHHzP4uVpn4C\u0026amp;pg\u003dPA91\u0026amp;dq\u003d%22Harappa%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dOsVpU7L2KoPvlAW-3oGABQ\u0026amp;redir_esc\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22Harappa%22\u0026amp;f\u003dfalse page 91\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Renewed excavations at \u0027\u0027Harappa\u0027\u0027 from 1986 onwards and at several other sites have produced a series of radiocarbon dates\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Karen Tate, \u0027Sacred Places of Goddess: 108 Destinations\u0027, [http://books.google.com.au/books?id\u003db7KbLLjzuRgC\u0026amp;pg\u003dPA207\u0026amp;dq\u003d%22Harappa%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dOsVpU7L2KoPvlAW-3oGABQ\u0026amp;redir_esc\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22Harappa%22\u0026amp;f\u003dfalse page 207\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"Within the confines of Mohenjo-daro and \u0027\u0027Harappa\u0027\u0027, two of the more famous of the many ancient archaeological sites from the Indus Valley Civilization (IVC), we find evidence of the oldest forms of Goddess worship\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Jane McIntosh, \u0027The Ancient Indus Valley: New Perspectives\u0027, [http://books.google.com.au/books?id\u003d1AJO2A-CbccC\u0026amp;pg\u003dPA385\u0026amp;dq\u003d%22Harappa%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dOsVpU7L2KoPvlAW-3oGABQ\u0026amp;redir_esc\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22Harappa%22\u0026amp;f\u003dfalse page 385\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"The early picture of the Indus civilization was largely based on what was revealed by excavations in the two great cities of Mohenjo-daro and \u0027\u0027Harappa\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"The Harappan Civilization, or Indus Valley Civilization, a Bronze Age civilization that flourished in a large region encompassing the site\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"1989\u0027\u0027, Amalananda Ghosh (editor), \u0026quot;Rangpur,\u0026quot; entry in \u0027An Encyclopaedia of Indian Archaeology\u0027, [http://books.google.com.au/books?id\u003dlaw3AAAAIAAJ\u0026amp;pg\u003dPA370\u0026amp;dq\u003d%22Harappa%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dOsVpU7L2KoPvlAW-3oGABQ\u0026amp;redir_esc\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22Harappa%22\u0026amp;f\u003dfalse page 370\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"He declared that it was a site of the late period of \u0027\u0027Harappa\u0027\u0027 culture [4.9] on the basis of certain pottery types and painted designs thereon and that \u0027the mere fact that the Indus culture is by this discovery pushed so far s.-e. as Kathiawar is a matter of great importance\", \"priority\":21}]}, \"synonyms\":{}}");

