	add("hardheartedness", "{\"term\":\"hardheartedness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|hardhearted|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of being hardhearted\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A hardhearted thought or act\", \"priority\":2}]}, \"synonyms\":{}}");

	add("hardihood", "{\"term\":\"hardihood\", \"etymology\":{\"influencers\":[], \"languages\":[\"German\", \"Dutch\"], \"text\":\"From {{suffix|hardy|hood|lang\u003den}}. Compare Dutch \u0027hardigheid\u0027 (hardness, callousness) German \u0027hartigkeit\u0027 (hardness)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Unyielding boldness and daring; firmness in doing something that exposes one to difficulty, danger, or calamity; intrepidness\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1902\u0027\u0027, Joseph Conrad, \u0027Heart of Darkness\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Their talk, however, was the talk of sordid buccaneers: it was reckless without \u0027\u0027hardihood\u0027\u0027, greedy without audacity, and cruel without courage; there was not an atom of foresight or of serious intention in the whole batch of them, and they did not seem aware these things are wanted for the work of the world\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1971\u0027\u0027, John Morris Dorsey, \u0027Psychology of Emotion\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Once endured it is enjoyed as my owndom. Elsewhere I refer to this process of enduring hardship as the only possible source of \u0027\u0027hardihood\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Excessive boldness; foolish daring; offensive assurance\", \"priority\":6}]}, \"synonyms\":{}}");

	add("hardiment", "{\"term\":\"hardiment\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) \u0027hardiment\u0027 from \u0027hardi\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Bravery, courage\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1590\u0027\u0027, Edmund Spenser, \u0027The Faerie Queene\u0027, I.i\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"But full of fire and greedy \u0027\u0027hardiment\u0027\u0027, / The youthfull knight could not for ought be staide\", \"priority\":3}]}, \"synonyms\":{}}");

	add("hardiness", "{\"term\":\"hardiness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|hardy|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of being hardy, especially (of a plant) of being resistant to cold or other environmental conditions\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"hardihood; boldness; firmness; assuranc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Shakespeare, \u0027Cymbeline\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Plenty and peace breeds cowards; Hardness ever / Of \u0027\u0027hardiness\u0027\u0027 is mother\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Clarendo\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"They who were not yet grown to the \u0027\u0027hardiness\u0027\u0027 of avowing the contempt of the king\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"hardship; fatigu\", \"priority\":7}]}, \"synonyms\":{}}");

