	add("hardstyle", "{\"term\":\"hardstyle\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|hard|style|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A genre of music that combines elements of trance, hardcore, and rave\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, \u0026quot;mik\u0026quot;, \u0027gabber/terror/hardcore\u0027 (on newsgroup \u0027uk.music.rave\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"hi jack. you just missed the best hardcore/gabba party: \u0026quot;thunderdome - a decade\u0026quot;, here in amsterdam. 2 huge rooms filled with 15.000 people (the party had sold out weeks in advance), one room for oldstyle (92-97), one for the newer hardcore/\u0027\u0027hardstyle\u0027\u0027 (97-02\", \"priority\":3}]}, \"synonyms\":{}}");

	add("hardware", "{\"term\":\"hardware\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|hard|ware|lang\u003den}}; attested since the mid-15th century.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Fixtures, equipment, tools and devices used for general-purpose construction and repair of a structure or object. Also such equipment as sold as stock by a store of the same name, e.g. hardware store\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"He needed a hammer, nails, screws, nuts, bolts and other assorted \u0027\u0027hardware\u0027\u0027, so he went to the hardware store\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Equipment\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"military \u0027\u0027hardware\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The part of a computer that is fixed and cannot be altered without replacement or physical modification; motherboard, expansion cards, etc. Compare software\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1952\u0027\u0027, \u0026quot;Binary Arithmetic\u0026quot;, R.L. Michaelson, in \u0027The Incorporated Statistician\u0027, vol. 3, no. 1 (Feb. 1952), pp 35-40\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Hardware\u0027\u0027 is the generally accepted colloquism for anything inside a computer other than an engineer\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Electronic equipment\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Metal implements\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A firearm\", \"priority\":10}]}, \"synonyms\":{}}");

