	add("harem", "{\"term\":\"harem\", \"etymology\":{\"influencers\":[], \"languages\":[\"Arabic\", \"English\", \"Turkish\"], \"text\":\"From Turkish \u0027harem\u0027 from Arabic \u0027ÿ≠Ÿéÿ±ŸéŸÖ\u0027 (something prohibited; sanctuary, women) and later also from \u0027ÿ≠Ÿéÿ±ŸêŸäŸÖ\u0027 with same meaning, both from \u0027ÿ≠Ÿéÿ±ŸèŸÖŸé\u0027 (be forbidden or unlawful) (Eng. usg. 1623)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The private part of an Arab household. In traditional Arab culture, this part of the household was forbidden to male strangers\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A group of women, wives and/or concubines in a polygamous household\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A group of female animals (cows) herded and controlled by a male animal (bull) of that species for breeding purposes. Such behaviour is exhibited by bovids including cattle and buffalo as well as moose, elephants, seals, sea lions, sea elephants\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Any significant number of women together as a group; bevy\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A genre of anime and manga in which a man is the love interest of three or more members of the opposing sex\", \"priority\":5}]}, \"synonyms\":{}}");

