	add("harlequin", "{\"term\":\"harlequin\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle french (ca. 1400-1600)\", \"old french (842-ca. 1400)\", \"Italian\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027harlequin\u0027 (in Italian \u0027arlecchino\u0027 the name of a popular servant character in \u0027commedia dell\u0027arte\u0027 plays) from Old french (842-ca. 1400) *\u0027\u0027 (harlequin, halequin, herlequin, hellequin) connected to the Old english (ca. 450-1100) figure of \u0027herla cyning\u0027 (king herla) a mythical figure identified with Woden.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a pantomime fool, typically dressed in checkered clothe\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1749,\u0027\u0027 Henry Fielding, \u0027The History of Tom Jones, a Foundling\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"were certainly the worst and dullest company into which an audience was ever introduced; and (which was a secret known to few) were actually intended so to be, in order to contrast the comic part of the entertainment, and to display the tricks of \u0027\u0027harlequin\u0027\u0027 to the better advantage\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A yellowish-green color\", \"priority\":4}]}, \"synonyms\":{}}");

	add("harlequinade", "{\"term\":\"harlequinade\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027arlequinade\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A pantomime-like comedy featuring the harlequin or clown\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Any comical or fantastical procedure or playfulness\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1891\u0027\u0027, Mary Noailles Murfree, \u0027In the \u0026quot;Stranger People\u0027s\u0026quot; Country\u0027, Nebraska 2005, p. 154\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Away up the gorge all diurnal fancies trooped into the wide liberties of endless luminous vistas of azure sunlit mountains beneath the shining azure heavens, the ranges and valleys changing with every mood of the atmosphere, with the \u0027\u0027harlequinade\u0027\u0027 of the clouds and the wind\", \"priority\":4}]}, \"synonyms\":{}}");

