	add("harmfulness", "{\"term\":\"harmfulness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|harmful|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The characteristic of being harmful\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1922\u0027\u0027, w:Edith Edith Wharton, \u0027The Glimpses of the Moon\u0027, ch. 8\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Once his word was pledged, he was safe: otherwise there was no limit to his capacity for wilful \u0027\u0027harmfulness\", \"priority\":3}]}, \"synonyms\":{}}");

