	add("harmonica", "{\"term\":\"harmonica\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a musical wind instrument with a series of holes for the player to blow into, each hole producing a different not\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"a musical instrument, consisting of a series of hemispherical glasses which, by touching the edges with the dampened finger, give forth the tones\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"a toy instrument of strips of glass or metal hung on two tapes, and struck with hammers\", \"priority\":3}]}, \"synonyms\":{}}");

	add("harmonization", "{\"term\":\"harmonization\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|harmonize|ation|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An act of harmonizing\", \"priority\":1}]}, \"synonyms\":{}}");

	add("harmony", "{\"term\":\"harmony\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"First attested in 1602. From Middle english (1100-1500) {{m|enm|armonye}}, from Old french (842-ca. 1400) {{m|fro|harmonie}}/{{m|fro|armonie}}, from Latin {{m|la|harmonia}}, from Ancient greek (to 1453) {{m|grc|·ºÅœÅŒºŒøŒΩŒØŒ±||joint, union, agreement, concord of sounds}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Agreement or accord\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"America\u0027s social \u0027\u0027harmony\u0027\u0027 has depended at least to some degree on economic growth. It is easier to get along when everyone, more or less, is getting ahead.\u0027 \u0026amp;mdash; w:Evan Evan Thomas, \u0027[http://www.newsweek.com/2010/12/04/the-deepest-dangers-facing-the-united-states.html Why It‚Äôs Time to Worry]\u0027, Newsweek 2010-12-0\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A pleasing combination of elements, or arrangement of sounds\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The academic study of chords\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Two or more notes played simultaneously to produce a chord\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The relationship between two distinct musical pitches (musical pitches being frequencies of vibration which produce audible sound) played simultaneously\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A literary work which brings together or arranges systematically parallel passages of historians respecting the same events, and shows their agreement or consistency\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"a \u0027\u0027harmony\u0027\u0027 of the Gospels\", \"priority\":8}]}, \"synonyms\":{}}");

	add("harness", "{\"term\":\"harness\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"anglo-norman\"], \"text\":\"Anglo-norman \u0027harneis\u0027 Old french (842-ca. 1400) \u0027hernois|lang\u003dfro\u0027 () from the Germanic elements of \u0027her\u0027 and \u0027nest\u0027, believed to be from Old Norse hernest.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A restraint or support, especially one consisting of a loop or network of rope or straps\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A collection of wires or cables bundled and routed according to their function\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The complete dress, especially in a military sense, of a man or a horse; armour in general\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1606\u0027\u0027 William Shakespeare, \u0027Macbeth\u0027, act V, scene\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Ring the alarum-bell! Blow, wind! come, wrack\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"At least we\u0027ll die with \u0027\u0027harness\u0027\u0027 on our back\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The part of a loom comprising the heddles, with their means of support and motion, by which the threads of the warp are alternately raised and depressed for the passage of the shuttle\", \"priority\":7}]}, \"synonyms\":{}}");

