	add("harpoon", "{\"term\":\"harpoon\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"ancient greek (to 1453)\", \"Latin\", \"Dutch\"], \"text\":\"From Old french (842-ca. 1400) \u0027harpon\u0027 from Latin \u0027harpaga\u0027 from Ancient greek (to 1453) \u0027·ºÅœÅœÄŒ¨Œ≥Œ∑\u0027 (hook) from \u0027·ºÅœÅœÄŒ¨Œ∂œâ\u0027 (to snatch away, to carry off, to seize, to captivate) Sense and spelling perhaps influenced by Dutch {{m|nl|harpoen||harpoon}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"File:Harpon Unaaq MHNT ETH AC thumb| harpoonImage:Whaling thumb|a whaling \u0027\u0027harpoon\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A spearlike weapon with a barbed head used in hunting whales and large fish\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A harmonica\", \"priority\":3}]}, \"synonyms\":{}}");

