	add("harpsichord", "{\"term\":\"harpsichord\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"English\", \"French\", \"Latin\"], \"text\":\"From French \u0027harpechorde\u0027 from Modern Latin \u0027harpicordium\u0027 from \u0027harpa\u0027 (harp) + \u0027corda\u0027 (string)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A musical instrument that produces sound by plucking the strings with a plectrum through a mechanical process when the performer presses on a key on a piano-like keyboard, originating in Middle Ages Europe\", \"priority\":1}]}, \"synonyms\":{}}");

