	add("harrier", "{\"term\":\"harrier\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{PIE root|en|ker}}{{suffix|harry|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who harr\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"harries\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Any of several bird of birds of prey in the genus \u0027Circus\u0027 of the subfamily Circinae which fly low over meadows and marshes and hunt small mammals or birds\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A runner, specifically, a cross country runner\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A kind of dog used to hunt hares; a harehound\", \"priority\":5}]}, \"synonyms\":{}}");

	add("harriet", "{\"term\":\"harriet\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"Anglicized form of French Henriette, feminine form of Henri ( Henry), popular in England in the eighteenth and nineteenth centuries.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"1833\u0027\u0027 w:Leigh Leigh Hunt, \u0027A Year of Honey-Moons\u0027, Court magazine and monthly, E. Bull 1833, page 33\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Harriet\u0027\u0027, by the way, is a very sprightly name. It is the female of Harry, and is identified in my imagination with I know not what of the power of being lively and saucy, without committing the sweetness of womanhood\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1995\u0027\u0027 Elizabeth Wurtzel: \u0027Prozac Nation: Young and Depressed in America\u0027, Riverhead Books, 1995, ISBN 1573225126, page 1\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"I found myself wanting to explain it to her, this middle-aged woman with the kind of haircut you call a hairdo, which needed to be set in rollers every night, who had a name like Agnes or \u0027\u0027Harriet\u0027\u0027, a name that even predated my mother\u0027s generation\", \"priority\":4}]}, \"synonyms\":{}}");

