	add("harvest", "{\"term\":\"harvest\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\"], \"text\":\"{{PIE root|en|kerp}}From Middle english (1100-1500) \u0027harvest\u0027 \u0027hervest\u0027 from Old english (ca. 450-1100) \u0027h√¶rfest\u0027 (autumn, harvest-time; august) from Proto-germanic {{m|gem-pro|*harbistaz||harvest-time, autumn, fall}}, from {{m|gem-pro|*harbaz}}, from Proto-indo-european {{m|ine-pro|*kerp-}}. Cognate with West Frisian \u0027hjerst\u0027 Dutch \u0027herfst\u0027 German \u0027herbst\u0027 Middle Low German \u0027hervest\u0027 (autumn) (Dutch Low Saxon \u0027haarfst\u0027 (autumn) , Danish \u0027h√∏st\u0027 also Latin \u0027carpere\u0027 \u0027to seize\u0027, Greek \u0027Œ∫Œ±œÅœÄœåœÇ|lang\u003dgrc\u0027 () and \u0027Œ∫ŒµŒØœÅœâ|lang\u003dgrc\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The third season of the year; autumn; fall\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The season of gathering ripened crops; specifically, the time of reaping and gathering grain\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The process of harvesting, gathering the ripened crop\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The yield of harvesting, i.e. the gathered crops or fruits\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"This year\u0027s cotton \u0027\u0027harvest\u0027\u0027 was great but the corn \u0027\u0027harvest\u0027\u0027 was disastrous\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1911\u0027\u0027, \u0027The Whale Tooth\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The frizzle-headed man-eaters were loath to leave their fleshpots so long as the \u0027\u0027harvest\u0027\u0027 of human carcases was plentiful. Sometimes, when the \u0027\u0027harvest\u0027\u0027 was too plentiful, they imposed on the missionaries by letting the word slip out that on such a day there would be a killing and a barbecue\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"To glean the broken ears after the man / That the main \u0027\u0027harvest\u0027\u0027 reaps\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The product or result of any exertion or labor; gain; reward\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Fulle\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"The pope\u0027s principal \u0027\u0027harvest\u0027\u0027 was in the jubilee\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Wordswort\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"the \u0027\u0027harvest\u0027\u0027 of a quiet ey\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"A modern pagan ceremony held on or around the autumn equinox, which is in the harvesting season\", \"priority\":15}]}, \"synonyms\":{}}");

